** -- ** -- ** -- ** --

EOF


cat <<'EOF-MESSAGE'
Script created for 564 file(s)
(The count won't match if you manually edit this file!)



EOF-MESSAGE
sleep 1

check_os
((!skip_security)) && find_credentials

if ((use_http_sec))
then 
     
 if (( ! insecure))
